INSERT INTO `mod_page` (`id_page`, `judul`, `isi`, `tgl_posting`, `gambar`, `statis`, `extra`, `meta_keyword`, `meta_deskripsi`) VALUES
(1, 'Home', '<p>Hijab Jogja Store</p>', '2013-06-17', '', 'Y', '', 'Hijab Jogja Store', 'Hijab Jogja Store'),
(2, 'Tentang Kami', '<div class="row row-top-margin row-bottom-margin" data-reactid="636">\r\n<div class="column small-12 large-6 large-offset-3" data-reactid="637">\r\n<p>HIJUP.com adalah Islamic fashion e-commerce pertama di dunia yang didirikan pada tahun 2011. Dengan konsep online mall, HIJUP.com menyediakan berbagai macam produk terbaik karya designer fashion muslimah Indonesia. Produk yang kami sediakan ditujukan khusus untuk wanita Muslim, dari mulai pakaian, kerudung, aksesoris dan banyak lagi yang lainnya.</p>\r\n<p>Sejak awal berdiri, HIJUP.com berperan sebagai perantara antara para designer dengan calon pembeli di seluruh dunia. Dengan HIJUP.com para designer dapat meningkatkan keuntungan dengan lebih efisien sementara calon pembeli jadi lebih mudah mencari produk yang diinginkan.</p>\r\n<p>HIJUP adalah kependekan dari Hijab Up (seperti pada kata make up atau dress up). Karena kami yakin bahwa kami bisa memberikan sesuatu yang lebih kepada wanita Muslim di seluruh dunia. Bahwa Hijab tidak membatasi mereka untuk berkarya dan diakui oleh lingkungan sekitarnya. Mereka layak untuk tampil menawan dengan pakaian yang cantik dan mengikuti trend namun tetap syari</p>\r\n</div>\r\n</div>', '2013-02-13', '', 'Y', '', 'Hijab Jogja Store', 'Online Shop Hijab Jogja Store'),
(3, '', 'konten dinamis', '2013-02-17', '', 'N', '', 'produk', ''),
(4, 'Artikel', '<p><span style="font-size: large;"><strong>Membuat Kerajinan Tangan yang Mudah Dijual</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;">Oleh: <a href="http://anneahira.com">AnneAhira.com</a> Content Team<br /><br /> <a href="http://jogjacraftcenter.com">Kerajinan</a> tangan merupakan hasil olah keterampilan yang dilakukan oleh seserang atau sekelompok orang untuk dikoleksi sendiri atau diperjual belikan</span></p>\r\n<p><span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;">.<br />Dengan cara seperti ini, maka <a href="http://jogjacraftcenter.com">kerajinan tangan</a> dapat dijadikan sebagai peluang usaha atau bisnis bagi orang-orang. Dan, untuk kondisi ini, maka setiap orang berusaha membuat kerajinan tangan yang mudah dijual.Pada kondisi kehidupan yang serba ketat ini, kita memang sudah seharusnya mempunyai tingkat kreativitas yang tinggi. Kita pun harus selalu memperhatikan berbagai peluang usaha yang dapat dijadikan sebagai sumber pendapatan. Kita harus dapat membuat <a href="http://jogjacraftcenter.net/tas/">kerajinan tangan</a> yang mudah dijual agar kita mempunyai sumber penghasilan selain pekerjaan utama kita.Sebenarnya tidaklah sulit membuat kerajinan tangan yang mudah dijual sebab ada banyak bahan yang dapat dipergunakan di sekitar kehidupan kita. Negeri kita sangat kaya atas bahan-bahan yang dapat menjadi keterampilan hidup. Bahkan, bahan yang kelihatannya sepele, dapat kita jadikan barang-barang dengan tingkat harga jual yang tinggi.</span></p>\r\n<p><span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;"><br />Bahan Dasar Tidak Perlu Mahal Untuk membuat <a href="http://jogjacraftcenter.net/taskerajinan/">kerajinan tangan</a> yang mudah dijual, kita memang hanya perlu tingkat kreativitas saja. Kita tidak perlu repot-repot mencari bahan dasar yang mahal di toko-toko. Untuk bahan yang kita gunakan untuk membuat kerajinan tangan yang mudah dijual dapat saja kita menggunakan bahan yang ada di sekitar kita, bahkan bahan bekas.</span></p>\r\n<p><span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;"><br />Membuat barang kerajinan tangan yang mudah dijual memang kita lebih menekankan pada tingkat keterampilan kita dan bukan bahan dasarnya. Dalam hal ini, kita memang menerapkan prinsip ekonomis, yaitu mengeluarkan modal sedikit tetapi mengambil hasil maksimal.<br />Dengan menggunakan bahan semurah mungkin, tetapi kita dapat menjual hasil kerajinan tangan tersebut dengan harga yang mahal. Dengan demikian, maka kita mendapatkan keuntungan yang lumayan.Di dalam kehidupan kita, seringkali kita melihat ada barang-barang yang sebenarnya terbuat dari bahan yang murah, tetapi begitu menarik dan harganya lumayan mahal. Hal inilah yang sesungguhnya selalu kita upayakan agar dapat menjadi sumber penghasilan hidup kita. Dan, memang ini merupakan bagian dari kreasi dan daya inovasi kita untuk menghadapi kehidupan yang semakin ketat persaingannya.<br />Bentuk Tidak Perlu Terlalu Ruwet</span></p>\r\n<p><span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;"><br />Kalau dapat dipermudah, mengapa pula harus dipersulit? Kalau ada yang mudah, mengapa mencari yang sulit? Begitu seringkali kita mendengar banyak orang berkomentar atas berbagai kegiatan hidup yang dialami oleh orang orang di sekitarnya.Dalam hal ini, pada saat kita membuat kerajinan tangan yang mudah dijual, maka perhitungan kita adalah sesuatu yang mudah. Kita harus membuat berbagai barang kerajinan yang sederhana, tetapi laku di pasar atau di masyarakat. Dengan demikian, maka barang-baran kerajinan yang kita hasilkan adalah barang-barang yang mempunyai tingkat kondisi sederhana.</span></p>\r\n<p><span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;"><br />Memang, agar barang kerajinan tangan yang kita buat dapat dengan segera kita jual, maka barang barang yang sederhana seringkali menjadi incaran banyak orang. Jaman sekarang ini, orang-orang lebih suka pada barang-barang yang sederhana.<br />Mereka ingin mempunyai barang-barang yang dapat dinikmati secara utuh karena konstruksinya yang sederhana. Orang-orang sekarang tidak perlu mengapresiasi barang-barang, bagi mereka kesederhanaan dan keunikan barang merupakan daya tarik tersendiri.<br />Sesuaikan Pangsa PasarUntuk memudahkan barang kerajinan tangan kita laku di masyarakat, maka kita harus menentukan pangsa pasar yang menjadi target barang kita. Hal ini sangat penting sebab dengan kesesuaian barang dengan targetnya, maka tingkat lakunya barang dapat meningkat.</span></p>\r\n<p><span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;"><br />Artinya, jika kita ingin menembak pangsa pasar anak-anak, maka kerajinan tangan yang kita produksi seharusnya sesuai dengan anak-anak. Jika barang yang kita hasilkan tidak sesuai dengan pangsa pasarnya, maka barang tersebut tidak dibutuhkan di masyarakat. Hal tersebut selanjutnya menjadikan barang tidak laku di masyarakat.Begitu juga halnya terkait dengan harga yang kita banderol pada barang kerajinan yang kita produksi. Kita harus menyesuaikan harga barang dengan kondisi perekonomian masyarakat. Jika memang lingkungan masyarakat termasuk kelompok ekonomi menengah ke bawah, maka barang kerajinan yang kita jual seharusnya barang yang mampu mereka beli.Kerajinan tangan yang mudah dijual memang seharusnya menjadi pertimbangan utama sebelum kita mulai menerjunkan diri dalam dunia bisnis. Kerajinan tangan memang merupakan peluang usaha yang masih terbuka lebar bagi semua orang. Tetapi, semua kembali pada kreativitas masing-masing orang dan kemauannya melakukan usaha kerajinan tangan ini.<br />Sumber: <a href="http://prospectinternetmarketing.com">AnneAhira.com</a> Content Team</span></p>\r\n<p>&nbsp;</p>\r\n<h3 class="post-title entry-title"><span style="font-size: large;"><strong>Keren Dengan Tas Kerajinan Tangan</strong></span></h3>\r\n<p>&nbsp;</p>\r\n<div class="post-header">&nbsp;</div>\r\n<p><span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;">Keren Dengan Tas Kerajinan Tangan<br style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;" />Oleh: <a href="http://anneahira.com">AnneAhira.com</a> Content Team<br /><br />Siapa yang tak membutuhkan <a href="http://jogjacraftcenter.com">tas</a>? Bagi sebagian orang, <a href="http://jogjacraftcenter.com">tas </a>bukan saja kebutuhan namun juga merupakan pelengkap penampilan.<br /><br />Untuk memenuhi semua keinginan konsumen ini, para produsen tas mengeluarkan berbagai bentuk dan ukuran tas. Warna dan bahan pembuatnya pun bermacam-macam. Kita dapat dengan mudah menemukan tas yang terbuat dari bahan kain, plastik, jeans, parasut, kulit, atau bahan-bahan kombinasinya. Di antara tas-tas buatan pabrik itu ada tas-tas yang tampak unik. Tas-tas ini adalah tas kerajinan tangan.<br /><br />Aneka <a href="http://jogjacraftcenter.com">Tas Kerajinan Tangan</a><br /><br />Tas kerajinan tangan ini tak hanya terbuat dari bahan-bahan yang sudah umum, seperti kain atau kulit. Sebaliknya, banyak tas kerajinan tangan ini terbuat dari bahan yang tak umum digunakan seperti: plastik bekas kemasan, kain perca, daun pandan, eceng gondok, batok kelapa, serat nanas, tali tambang, kaleng, dan sebagainya.<br /><br />Bentuk tas ini pun beragam. Mulai dari bentuk segi empat yang paling umum dan sederhana, hingga bentuk yang tak lazim. Bentuk tas kerajinan tangan yang tak lazim ini biasanya yang terbuat dari batok kelapa atau kaleng bekas.<br /><br />Tas yang terbuat dari batok kelapa berbentuk bulat dan berukuran kecil sebagaimana bentuk asli batok kelapa. Tas seperti ini lebih berfungsi sebagai aksesori. Kalaupun bisa diisi benda-benda, tentu terbatas pada benda-benda kecil seperti dompet atau ponsel.<br /><br />Namun, tas batok kelapa juga bisa berbentuk seperti layaknya tas dari bahan yang lain. Caranya, batok kelapa itu dipotong-potong terlebih dahulu dengan ukuran tertentu, baru disatukan kembali dengan menggunakan kawat atau tali kenur.<br /><br />Penampilan tas batok kelapa ini tentu tak sepolos batok kelapa asli yang baru dikupas. Tas batok kelapa ini sudah tampil cantik dan eksklusif. Dicat dengan warna natural (gradasi cokelat dan krem) serta dipernis mengkilat dan ditambahi aksesori-aksesori kecil seperti bunga kering, biji-bijian, atau kancing sebagai pemanis.<br /><br />Tas batok kelapa ini cocok sekali digunakan untuk menunjang penampilan yang bergaya etnik atau natural. Harga tas kerajinan tangan batok kelapa ini pun melambung tinggi dibandingkan batok kelapa yang hanya dijadikan sebagai bahan pembuat arang.<br /><br />Demikian pula tas kerajinan tangan yang terbuat dari kaleng. Ukuran tas dari bahan kaleng ini lebih beragam karena kaleng-kaleng yang bisa dijadikan bahan baku pun mempunyai aneka bentuk dan ukuran.<br /><br />Tas kaleng ini terlihat sangat unik dan kuat. Agar tak berisik, bagian dalamnya dilapisi dengan bahan yang lembut. Pembeli dan pengguna tas ini tentu tak ingin terdengar seperti pengamen jalanan dengan alat musik kecrekannya.<br /><br />Kuatkah Tas Kerajinan Tangan Ini?<br /><br />Jawabannya, relatif. Tergantung pada:<br /><br /> * Bahan pembuat tas. Tas dari bahan kaleng tentu memiliki kekuatan yang berdea dengan tas yang terbuat dari anyaman daun pandan.<br /><br /> * Cara penggunaan. Tas kerajinan tangan ini akan kuat dipakai dalam waktu cukup lama jika dipergunakan sesuai dengan kekuatannya. Tas yang terbuat dari eceng gondok, misalnya, sebaiknya jangan digunakan untuk membawa diktat-diktat tebal nan berat.<br /><br /> * Cara perawatan. Perbedaan bahan pembuat tas kerajinan tangan akan membedakan cara perawatan tas tersebut. Tas yang terbuat dari plastik bekas kemasan lebih tahan basah dan lebih mudah dirawat daripada tas yang terbuat dari serat batang pisang.<br /><br />Nah, jika ingin terlihat unik dan bergaya, mengapa tidak mencoba menggunakan tas kerajinan tangan ini?<br /><br />Sumber : <a href="http://prospectinternetmarketing.com">http://anneahira.com</a><br /></span></p>\r\n<p><span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;">&nbsp;</span></p>', '2013-02-17', '', 'N', '', 'grosir tas kerajinan, tas kerajinan jogja, tas anyaman jogja, tas enceng gondok, tas pandan tikar, t', 'testimoni'),
