(13, 'Kebijakan Privasi', '<div class="row column row-top-margin" data-reactid="637">\r\n<h2 class="static-page-subtitle" data-reactid="638"><span data-reactid="639">Aturan Penggunaan</span></h2>\r\n<p>Selamat datang di website HIJUP.com. Dengan mengakses website ini berarti Anda menyetujui aturan, pedoman, kebijakan, syarat dan ketentuan yang berlaku di website ini. Aturan, pedoman, syarat dan ketentuan yang berlaku pada website ini dapat berubah sewaktu-waktu.</p>\r\n<p>DENGAN MENGAKSES DAN MENGGUNAKAN WEBSITE INI BERARTI ANDA MENYETUJUI ATURAN, PEDOMAN, SYARAT DAN KETENTUAN YANG TERTERA DI BAWAH INI. MOHON MEMBACA DENGAN CERMAT PERSETUJUAN DI BAWAH INI SEBELUM MELAKUKAN TRANSAKSI DI WEBSITE INI.</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="641">\r\n<h2 class="static-page-subtitle" data-reactid="642"><span data-reactid="643">Pembatasan</span></h2>\r\n<p>Merek dagang, logo, fotografi, ilustrasi, gambar, dan grafis semuanya milik HIJUP.com. Anda tidak boleh menyalin, memodifikasi, memperbanyak, menjual atau mengeksploitasi dengan cara apapun isi dari situs ini atau perangkat lunak terkait tanpa seizin kami.</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="645">\r\n<h2 class="static-page-subtitle" data-reactid="646"><span data-reactid="647">Kebijakan Privasi</span></h2>\r\n<p>Terima kasih telah mengakses website HIJUP.com. Kami sangat menghormati kenyamanan privasi Anda dan melindungi informasi pribadi Anda sebaik-baiknya. Ketika anda mendaftar atau berbelanja di HIJUP.com, kami menyimpan nama, alamat pengiriman, nomor telepon, dan alamat email. Informasi yang kami dapatkan dari Anda akan digunakan untuk memproses dan mengirimkan pesanan anda. Kami mengamankan informasi pribadi Anda dengan baik. Segala informasi pribadi Anda tidak akan kami jual, sewa, atau bagikan kepada pihak lain kecuali seperti yang disebutkan di bawah ini.</p>\r\n<p>Kami dapat membagikan informasi anda kepada Penyedia Layanan Pihak Ketiga Berwenang. Kami menyediakan beberapa produk layanan melalui pihak ketiga. &ldquo;Penyedia Layanan Pihak Ketiga&rdquo; tersebut melakukan fungsinya sesuai kepentingan seperti mengirim atau mendistribusikan email promosi dan melakukan proses pengiriman melalui jasa pengiriman dimana mereka mengirimkan produk kami kepada Anda. Kami membagikan informasi pribadi Anda kepada Penyedia Layanan tersebut untuk mengirim email, menghapus informasi yang berulang pada data customer, manganalisis data, menyediakan asisten pemasaran, menyediakan hasil pencarian dan links, mengoperasikan situs, memecahkan masalah, dan menyediakan customer service. Kami juga mengumpulkan informasi pribadi dari individu dan perusahaan (&ldquo;Affiliates&rdquo;) dengan mereka yang memiliki hubungan kerjasama bisnis. Kami juga berbagi informasi dengan Penyedia Layanan untuk menyelesaikan proses administrasi. Kami mendorong Penyedia Pihak Ketiga untuk bertindak setiap saat sesuai dengan Kebijakan Privasi kami serta untuk mengadopsi dan memposting kebijakan privasi mereka sendiri.</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="649">\r\n<h2 class="static-page-subtitle" data-reactid="650"><span data-reactid="651">Berhenti berlangganan</span></h2>\r\n<p>Jika sebelumnya Anda telah setuju untuk membagikan informasi Anda untuk tujuan marketing, tapi kemudian ingin berhenti menerima informasi marketing dari kami, silakan menekan tautan unsubsribe di email marketing kami. Jika Anda ingin mengetahui tujuan penggunaan informasi Anda, silakan menghubungi kami di contact@hijup.com atau +6221-78-24-001</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="653">\r\n<h2 class="static-page-subtitle" data-reactid="654"><span data-reactid="655">Penyangkalan</span></h2>\r\n<p>HIJUP.com dapat mengubah isi website kapan saja. Kami berhak mengubah kebijakan, foto produk, dan deskripsi produk sewaktu-waktu dan tanpa pemberitahuan. Warna pakaian dapat berbeda tergantung monitor yang Anda gunakan.</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="657">\r\n<h2 class="static-page-subtitle" data-reactid="658"><span data-reactid="659">Kesalahan Pengetikan</span></h2>\r\n<p>Apabila ada kesalahan dalam harga dan informasi yang tercantum pada produk yang disebabkan oleh kesalahan pengetikan yang dilakukan oleh tenant, kami berhak untuk menolak atau membatalkan pesanan apabila Anda telah memesan barang dengan harga dan informasi yang salah dicantumkan. Kami juga berhak untuk menolak atau membatalkan pesanan apabila Anda ingin membatalkan pesanan yang telah dibayar. Anda berhak mendapatkan uang Anda apabila Anda membatalkan pesanan yang telah dibayar.</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="661">\r\n<h2 class="static-page-subtitle" data-reactid="662"><span data-reactid="663">Pertanyaan Lebih Lanjut</span></h2>\r\n<span data-reactid="664">Untuk pertanyaan lebih lanjut, saran, dan kritik silakan hubungi kami melalui email di customer@hijup.com.</span></div>', NULL, NULL, 'Y', NULL, 'Isi Keyword Disini', ''),
(14, 'Syarat & Ketentuan', '<div class="row column row-top-margin" data-reactid="636">\r\n<h2 class="static-page-subtitle" data-reactid="637">Ketersediaan Barang</h2>\r\n<p data-reactid="638"><span data-reactid="639">Setiap produk di HIJUP.com tersedia sepanjang tidak ditandai "Sold Out". Ketika produk sudah terjual semua atau stok habis dan jika stok produk akan diisi kembali, Anda dapat meminta kami untuk mengirimkan pemberitahuan via email jika produk sudah tersedia. Agar lebih mudah, follow kami di </span><a href="https://twitter.com/hijup" rel="noopener noreferrer" target="_blank" data-reactid="640">twitter@hijup</a><span data-reactid="641"> atau like </span><a href="https://www.facebook.com/HIJUPcom/" rel="noopener noreferrer" target="_blank" data-reactid="642">facebook HIJUPcom</a><span data-reactid="643"> karena setiap barang tersedia kembali akan diinformasikan melalui twitter atau facebook.</span></p>\r\n<p data-reactid="644">Kami selalu memastikan agar sistem kami dapat bekerja dengan baik demi memberikan pelayanan terbaik kepada Anda. Jika tanpa sengaja Anda memesan sebuah produk yang stoknya tidak tersedia maka pesanan tersebut akan dibatalkan secara otomatis dan Anda akan memperoleh informasi melalui email atau telepon. Jika pesanan Anda telah dibatalkan namun Anda sudah membayar, Anda akan diberikan pilihan untuk membeli/menggantinya dengan produk lain atau meminta uang Anda kembali.</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="645">\r\n<h2 class="static-page-subtitle" data-reactid="646">Pembelian</h2>\r\n<p data-reactid="647">Setiap pembelian yang statusnya sudah "packed" atau "shipped" tidak dapat dibatalkan. HIJUP.com hanya menyediakan fasilitas Return (pengembalian) bila barang tidak sesuai. Informasi selengkapnya ada di bagian&nbsp;<a href="https://www.hijup.com/id/pages/terms_conditions#return-exchange-info" data-reactid="649">Pengembalian Barang</a>.</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="651">\r\n<h2 class="static-page-subtitle" data-reactid="652">Pembayaran</h2>\r\n<p data-reactid="653">Pembayaran dilakukan oleh pembeli dalam jangka waktu maksimal 1&times;12 jam setelah barang dibook online di HIJUP.com (checkout). Jika dalam jangka waktu tersebut pembeli belum melakukan pembayaran maka transaksi dianggap batal dan barang dikembalikan ke dalam sistem. Closing pembayaran melalui HIJUP.com dilakukan dalam jangka waktu maksimal 2 jam setelah pembeli melakukan konfirmasi pengiriman uang pada jam kerja dan hari kerja.</p>\r\n<p data-reactid="654">Jika pembayaran telah dilakukan, Anda harus mengkonfirmasi pembayaran melalui website kami dengan mengklik "Confirm Payment".</p>\r\n<p data-reactid="655">Setelah kami menerima pembayaran Anda, kami akan mengkonfirmasi pembayaran tersebut dan status pesanan Anda akan diganti menjadi "Confirmed" maksimal 2 jam setelah pembayaran (pada hari kerja). Setelah kami mengkonfirmasi pembayaran Anda, kami akan mengirim pesanan Anda pada hari berikutnya.</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="656">\r\n<h2 class="static-page-subtitle" data-reactid="657">Pengiriman Barang</h2>\r\n<p data-reactid="658">Pengiriman barang dilakukan oleh pihak HIJUP.com paling cepat 1&times;24 jam setelah konfirmasi pembayaran pada hari kerja. Lamanya waktu pengiriman tergantung jasa pengiriman yang dipilih. Setelah sampai di jasa pengiriman, barang berada di bawah tanggung jawab jasa pengiriman barang.</p>\r\n<ol data-reactid="659">\r\n<li data-reactid="660">\r\n<div class="bold" data-reactid="661">Biaya Pengiriman</div>\r\n<p data-reactid="662">Biaya pengiriman tergantung pada lokasi Anda dan berat produk yang Anda beli.</p>\r\n</li>\r\n<li data-reactid="663">\r\n<div class="bold" data-reactid="664">Lama Waktu Pengiriman</div>\r\n<p data-reactid="665">Pengiriman pesanan akan dilakukan dari kantor pusat kami di Jakarta. Pengiriman Reguler membutuhkan waktu 2&ndash;3 hari kerja. Perlu diperhatikan bahwa untuk beberapa kota, jasa pengiriman kami tidak menyediakan jasa kilat sehingga pengiriman mungkin membutuhkan waktu sampai dengan 6 hari kerja.</p>\r\n</li>\r\n</ol></div>\r\n<div class="row column row-top-margin" data-reactid="666">\r\n<h2 class="static-page-subtitle" data-reactid="667">Status Pesanan</h2>\r\n<p data-reactid="668">Anda dapat memeriksa status pesanan Anda dengan mengklik "Confirm / Track Order". Berikut adalah penjelasan mengenai masing-masing status pesanan:</p>\r\n<ol data-reactid="669">\r\n<li data-reactid="670">\r\n<div class="bold" data-reactid="671">New</div>\r\n<p data-reactid="672">Status "New" artinya Anda telah memesan produk yang diinginkan. Kami akan mengirimkan email yang berisi total biaya yang harus Anda bayar. Anda Akan mendapatkan penjelasan lebih rinci tentang bagaimana Anda dapat melakukan pembayaran.<br data-reactid="674" /><strong data-reactid="675">Perhatian:</strong> status "New" akan bertahan paling lama 1&times;12 jam setelah Anda melakukan pemesanan. Produk akan dijual menurut sistem "First&ndash;Pay, First&ndash;served", pesanan Anda akan dibatalkan oleh sistem secara otomatis jika Anda tidak melakukan pembayaran dan konfirmasi dalam waktu 1&times;12 jam sejak Anda memesan. HIJUP.com dioperasikan dengan sistem yang sangat terorganisir, untuk itu Anda harus melakukan konfirmasi pembayaran segera setelah pembayaran Anda berhasil. Klik tanda "Confirm Payment" di halaman pesanan Anda. Klik tanda "Confirm Payment" seperti yang telah didefinisikan dan masukkan ID pesanan Anda. Setelah kami mengkonfirmasi pembayaran Anda, kami akan mengirimkan pesanan Anda paling lambat pada hari berikutnya.</p>\r\n</li>\r\n<li data-reactid="677">\r\n<div class="bold" data-reactid="678">Confirmation Requested</div>\r\n<p data-reactid="679">Setelah Anda melakukan "Confirm Payment", status Anda akan berubah secara otomatis menjadi Confirmation Requested. Ini berarti Anda telah memberitahukan kami bahwa Anda telah melakukan pembayaran sesuai dengan informasi yang kami berikan sebelumnya. Setelah itu, kami akan mngkonfirmasi pembayaran Anda.</p>\r\n</li>\r\n<li data-reactid="680">\r\n<div class="bold" data-reactid="681">Confirmed</div>\r\n<p data-reactid="682">"Confirmed" artinya kami telah mengkonfirmasi dan menerima pembayaran Anda. Kami akan mengirim pesanan Anda dalam waktu 1&ndash;2 hari kerja setelah pembayaran dikonfirmasi.</p>\r\n</li>\r\n<li data-reactid="683">\r\n<div class="bold" data-reactid="684">Packed</div>\r\n<p data-reactid="685">"Packed" berarti pesanan Anda sudah dikemas dan akan kami teruskan kepada jasa pengiriman.</p>\r\n</li>\r\n<li data-reactid="686">\r\n<div class="bold" data-reactid="687">Delivered</div>\r\n<p data-reactid="688">"Shipped" berarti barang Anda telah dikirim ke perusahaan jasa pengiriman dan akan dikirim ke alamat Anda yang terdaftar.</p>\r\n</li>\r\n</ol></div>\r\n<div class="row column row-top-margin" data-reactid="689">\r\n<h2 class="static-page-subtitle" data-reactid="690">Customer Service</h2>\r\n<p data-reactid="691">HIJUP.com hanya akan melayani pertanyaan dari pelanggan seputar masalah teknis pembelian dan pengiriman barang. Segala pertanyaan seputar barang akan diteruskan ke Tenant dan menjadi tanggung jawab Tenant. Pertanyaan seputar pembayaran dan pengiriman barang secara online via contact form HIJUP.com akan dibalas/diteruskan paling lambat setengah hari kerja (4 jam).</p>\r\n</div>\r\n<div class="row column row-top-margin" data-reactid="692">\r\n<h2 id="return-exchange-info" class="static-page-subtitle" data-reactid="693">Pengembalian Barang</h2>\r\n<p data-reactid="694">Demi mengutamakan pelayanan yang maksimal kepada pembeli di HIJUP.com, kami menyediakan fasilitas Pengembalian Barang (Return). Pembeli dapat menggunakan fasilitas ini apabila ukuran barang yang diterima tidak sesuai dengan ukuran yang dipesan atau terdapat cacat. Karena pembeli tidak dapat melakukan pembatalan pembelian barang, pembeli harus menukarkan dengan produk yang sama dengan ukuran yang sesuai atau yang tidak cacat. Pengembalian hanya dapat dilakukan dalam jangka waktu 2&times;24 jam sejak barang diterima via jasa pengiriman barang. Pembeli yang melakukan pengembalian barang wajib melampirkan dokumen tanda terima barang.</p>\r\n</div>', NULL, NULL, 'Y', NULL, 'Isi Keyword Disini', '');
